"ko": |-
  To 헤더 필드는 From 필드에서 식별된 사용자가 지정한 요청의 원래 수신자를 식별합니다. 원래 수신자는 착신 전환이나 기타 프록시 작업으로 인해 요청을 처리하는 UAS일 수도 있고 아닐 수도 있습니다. UAS는 To가 수신될 때 요청을 수락할지 여부를 결정하기 위해 원하는 정책을 적용할 수 있습니다.
